    false,nt"url": null,nt"notes": "This narrative report for Upper Mississippi
    River Wildlife and Fish Refuge outlines Refuge accomplishments from January through
    April of 1950. The report begins by summarizing the weather conditions, habitat
    conditions, water conditions, and food and cover during this period. Wildlife- including
    migratory birds, upland game birds, big game animals, furbearers, and fish- is also
    covered. The Refuge development and maintenance section discusses physical developments.
    Resource management is outlined; topics include timber removal. A progress report
    on field investigations and applied research is also provided. The public relations
    section of the report describes recreational uses, Refuge visitors, fishing, and
    violations. Items of interest, N-R forms, and photographs are attached.",nt"license_title":
